import React, { useState } from "react";
import "./GstForm.css";

const GstForm = () => {
  return (
    <div className="GStformcontainer">

<div className="home-input-containerGSTForm">
      <div className="home-container1">
        <h1>GST Registration</h1>
        <div className="gstform_rowitems">
          <label>Constitution</label>
          
          <select
                defaultValue={"Select..."}
               required
               onChange={Handle}
                placeholder="Category"
              >
                <option value="">Options...</option>
                <option value="Individual/Proprietor">Individual/Proprietor</option>
                <option value="Partnership">Partnership</option>
                <option value="Pvt Ltd">Pvt Ltd</option>
                <option value="OPC">OPC</option>
                <option value="Trust">Trust</option>
                <option value="LCP">LCP</option>
              </select>
        </div>

        <div className="gstform_rowitems">
          <label>CIN</label>
          <input
            type="text"
            required
            placeholder="Your CIN"
            className="home-textinput input"
            onChange={(event) => {
              setCIN(event.target.value);
            }}
          />
        </div>
        <div className="gstform_rowitems">
          <label>Proposed Name</label>
          <input
            type="text"
            placeholder="Your Proposed Name"
            className="home-textinput input"
            onChange={(event) => {
              setProposedname(event.target.value);
            }}
          />
        </div>
        <div className="gstform_rowitems">
          <label>No of Directors</label>
          <input
            type="number"
            placeholder="Number"
            className="home-textinput input"
            onChange={(event) => {
              setNumberofdirectors(event.target.value);
            }}
          />
        </div>
        <div className="gstform_rowitems">
          <label>Business Address</label>
          <input
            type="text"
            placeholder="Enter Address"
            className="home-textinput input"
            onChange={(event) => {
              setBusinessAddress(event.target.value);
            }}
          />
        </div>

        <div className="gstform_rowitems">
          <label>Phone Number </label>
          <input
            type="text"
            placeholder="Enter Phone"
            className="home-textinput input"
            onChange={(event) => {
              setPhonenumber(event.target.value);
            }}
          />
        </div>

        <div className="gstform_rowitems">
          <label>Email ID</label>
          <input
            type="text"
            placeholder="Enter Email"
            className="home-textinput input"
            onChange={(event) => {
              setEmailid(event.target.value);
            }}
          />
        </div>

        <button  type="submit" className="home-button button-primary button">Submit</button>
      </div>
    </div>
    </div>
    
  );
};

export default GstForm;
